import './css/Forum.css';

function Forum(){
    return(
        <main>
            <div class="thems">
                <nav>
                    <li><h3>3D обсуждения</h3></li>
                    <li><p>3D Редактор</p></li>
                    <li><p>Как начать</p></li>
                    <li><p>3D персонажи</p></li> 
                    <li><h3>2D обсуждения</h3></li>
                    <li><p>2D Редактор</p></li>
                    <li><p>Как начать</p></li>
                    <li><p>2D персонажи</p></li>
                    <li><h3>Работа сайта</h3></li>
                    <li><p>Ошибки/Баги</p></li>
                    <li><p>Официальные оповещения</p></li>           
                </nav>
            </div>
        </main>
    );
}

export default Forum;
